import { createRouter, createWebHashHistory } from 'vue-router'
import Home from '@/views/home/indexPage.vue'

const routerArr = [
    {
        path: '/',
        redirect: 'home'
    },
    {
        path: '/home',
        component: Home
    },
    {
        path: '/echartsOne',
        component: () => import('@/views/test/echartsOne.vue'),
        name: 'echartsOne'
    },
    {
        path: '/echartsTwo',
        component: () => import('@/views/test/echartsTwo.vue'),
        name: 'echartsTwo'
    },
    {
        path: '/echartsThree',
        component: () => import('@/views/test/echartsThree.vue'),
        name: 'echartsThree'
    },
    {
        path: '/echartsFour',
        component: () => import('@/views/test/echartsFour.vue'),
        name: 'echartsFour'
    }
]

const router = createRouter({
    history: createWebHashHistory(),
    routes: routerArr
})

export default router
